import React from 'react';
import './Navbar.css';
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <a href="#">Home</a>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/movie">Movie</Link>
          <a href="#">Movies</a>
        </li>
        {/* <li>
          <a href="#">TV Series</a>
        </li> */}
        <li>
        <Link to="/popular">POPULAR</Link>
          <a href="#">Most Popular</a>
        </li>
        <li>
        <Link to="/topanime">Top Airing</Link>
          <a href="#">Top Airing</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
